import {React , useState} from 'react';

function T(){
  
    const[stud , setstud] = useState({
        name : "ali",
        age  : "19",
        collage: "life",
        status : "single"
    })
    return(
        <section >
            <div>
              <input type="text" placeholder='name' value = {stud.name} onChange={(e)=> setstud(e.target.value)} />
              <input type="number" placeholder='number' value = {stud.age} onChange={(e)=> setstud(e.target.value)} />
              <input type="text" placeholder='name' value = {stud.collage} onChange={(e)=> setstud(e.target.value)} />
              <input type="text" placeholder='name' value = {stud.status} onChange={(e)=> setstud(e.target.value)} />
           </div>
           <h2>student name : {stud.name}</h2>
           <h2>age : {stud.age}</h2>
           <h2> collage : {stud.collage}</h2>
           <h2> status : {stud.status}</h2>
        </section>
        
    )
}
export default T ;
